*{margin:0px; padding:0px;}
/*MainArea CSS*/
#wrapper{width:728px; height:20px; font-family:Arial,Verdana,sans-serif; overflow:hidden;}
/*border CSS*/
#border{border-style:solid; height:18px;
border-width:1px;
border-color:#FFFFFF;
background:#ffffff; position:relative;}
#ad-content{ height:18px; overflow: hidden; font-weight:bold; width:646px; float:left; word-wrap:break-word;}
#ad-content li{list-style:none; width:128px; line-height:16px; float:left;}
/*Keywords CSS*/
#ad-content li a{text-decoration:none; display:block; padding-left:8px;
font-size:16px;
color:#1122cc;
font-family:Arial;}
/*Keywords hover CSS*/
#ad-content li a:hover{text-decoration:underline;}
/*footer Area CSS*/
#footer{height:14px; height:16px; line-height:16px; text-align:right; padding-right:5px; width:75px; float:left;}
/*footer text CSS*/
#footer p a{text-decoration:none; display:block; font-size:11px;
color: rgb(170,170,170);}
/*group CSSS*/
.group:before,.group:after {content: '\0020'; display: block; overflow: hidden; visibility: hidden; width: 0; height: 0;}
.group:after {clear: both;}
.group:after{clear:both}
.group {zoom: 1;}
</style>
